import React from "react";
import SignInForm from "./SignInForm";
import logoDenied from "../Assets/Images/Denied.png";

class AccessDenied extends React.Component {


    render() {
        return <div>
            <img src={logoDenied} alt="Access Denied"/>
            <p>Access Denied !</p>
            <p>You don't have permissions to reach there</p>
        </div>
    }
}

export default AccessDenied;
